import React from 'react';
import { Chart as ChartJS, ArcElement, Tooltip, Legend } from 'chart.js';
import { Doughnut } from 'react-chartjs-2';

ChartJS.register(ArcElement, Tooltip, Legend);

export const data = {
  labels: ['Blue','Orange'],
  datasets: [
    {
      label: '# of Votes',
      data: [60, 40],
      backgroundColor: [
        'rgba(0, 162, 235, 1)',
        'rgba(255, 206, 86, 0.2)',
      ],
      borderColor: [
        'rgba(54, 162, 235, 1)',
        'rgba(0, 0, 0, 1)',
      ],
      borderWidth: 1,
    },
  ],
};

export default function ChartDonut() {
  return( 
    <div id="chart">
      <Doughnut data={data} />
    </div>
  );
}
